import "./App.css";
import { Users } from "./users";
import { useState } from "react";

function App() {
  const [query, setQuery] = useState("");

  return (
    <div className="app">
      <input
        type="text"
        placeholder="Search..."
        className="search"
        onChange={(event) => setQuery(event.target.value)}
      />
      <ul className="list">
        {Users.map((user) => (
          <li className="list-item" key={user.id}>
            {user.first_name}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
